import React from "react";

const PorfolioProject = props => {
  return (
    <div>
      {props.myPorftolio.map(portfolioUn => {
        let ok = "sisi";

        return (
          <div className="col-xl">
            <div className="card" style={{ width: "23rem", height: "330px" }}>
              <img src={portfolioUn.myImg} className="card-img-top" alt="..." />
              <div className="card-body ">
                <h3 className="card-title">{portfolioUn.mytitle}</h3>
                <p className="card-text">{portfolioUn.myContent}</p>
              </div>
            </div>
          </div>
        );
      })}
    </div>
  );
};

export default PorfolioProject;
